import {   Image, Text, View } from "react-native";
import { MEALS } from "../data/dummry-data";

const MaalDetailsScreen = ({route,navigation}) => {
 const mealId=route.params.mealId
 const seletedMeal=MEALS.filter((item)=>item.id=== mealId)

  return (
      <View>
        <Image source={{uri:seletedMeal.imageUrl}}/>
        <Text>{seletedMeal.title}</Text>
        <MaalDetails />
      </View>

  );
};
export default MaalDetailsScreen;
